  /// Get list of all subcounties
  static List<String> getSubcounties() {
    return administrativeUnits.keys.toList()..sort();
  }
  
  /// Get parishes for a given subcounty
  static List<String> getParishes(String subcounty) {
    final parishes = administrativeUnits[subcounty];
    if (parishes == null) return [];
    return parishes.keys.toList()..sort();
  }
  
  /// Get villages for a given parish in a subcounty
  static List<String> getVillages(String subcounty, String parish) {
    final parishes = administrativeUnits[subcounty];
    if (parishes == null) return [];
    return parishes[parish] ?? [];
  }
  
  /// Get total count of subcounties
  static int get subcountyCount => administrativeUnits.length;
  
  /// Get total count of parishes
  static int get parishCount {
    int count = 0;
    administrativeUnits.forEach((_, parishes) {
      count += parishes.length;
    });
    return count;
  }
  
  /// Get total count of villages
  static int get villageCount {
    int count = 0;
    administrativeUnits.forEach((_, parishes) {
      parishes.forEach((_, villages) {
        count += villages.length;
      });
    });
    return count;
  }
  
  /// Check if a subcounty exists
  static bool hasSubcounty(String subcounty) {
    return administrativeUnits.containsKey(subcounty);
  }
  
  /// Check if a parish exists in a subcounty
  static bool hasParish(String subcounty, String parish) {
    return administrativeUnits[subcounty]?.containsKey(parish) ?? false;
  }
  
  /// Check if a village exists in a parish
  static bool hasVillage(String subcounty, String parish, String village) {
    return administrativeUnits[subcounty]?[parish]?.contains(village) ?? false;
  }
